import React, { useState, useEffect } from 'react'
import houselisting from '../assets/mocks/data'
import ListingCard from '../components/ListingCard'

import MapContainer from '../components/MapContainer'


export default function listing() {
    let results;
    if (houselisting.length > 0) {
      results = houselisting.map((house, index) => 
      <ListingCard key={house.sys.id} {...house} />);
    } else {
      results = (
        <div>
          <h2>Sorry!</h2>
          <h3> No listings available yet.</h3>
        </div>
      );
    }

    return ( 
        <div id="content" style={{display: "flex"}}>  
          <div className="listings-container" style={{flex: "50%"}}>
            {results}
          </div>
          {/* <div className="map-container" style={{flex: "50%"}}>
            <MapContainer/>
          </div> */}
        </div>
  )
}
